import React from 'react';
// import { NavLink } from "react-router-dom"

const Navbar = () => {
  return (
    // <div>
    //   <strong>Villager Track</strong> New Island | Islands | Search Villagers <br />
    // </div>
    <nav className="navbar navbar-light navbar-expand-md">
      <div className="container-fluid"><p className="navbar-brand">Village Tracker</p><button data-toggle="collapse" className="navbar-toggler" data-target="#navcol-1"><span className="sr-only">Toggle navigation</span><span className="navbar-toggler-icon"></span></button>
        <div className="collapse navbar-collapse"
            id="navcol-1">
            <ul className="nav navbar-nav">
                <li className="nav-item nav-link" role="presentation">Islands</li>
                <li className="nav-item nav-link" role="presentation">Add Island</li>
                <li className="nav-item nav-link" role="presentation">Search Villagers</li>
            </ul>
        </div>
      </div>
  </nav>
  )
}

export default Navbar;
